A version-2 UUID is generated using the following steps:
1. Generate random numbers r and e, where r must be less than or equal to 65535 (0xffff) and e must be greater than or equal to 4 (0x4).
2. Compute t = ((r << 8) | e); store this value in u.
3. Set i = 0; while (i < 16) {
    if (t & 1) {
        b[i] = '1';
    } else {
        b[i] = '0';
    }
    i++;
    t >>= 1;
}
4. Store the resulting binary string as b into an array of length 16.
5. Convert each element of b from binary to hexadecimal notation by shifting it left by 4 bits and then masking off the low-order four bits with 0xf. This results in a sequence of characters that represent the UUID's components.
6. Join these components together to form the final UUID string. For example, if b were [0x3a, 0xc9, 0xe7, 0xa2], the resulting UUID would be "3aC9E7a2".

